/**
 * updated ver 0.19 shadow DOM support
 * banner element template
**/


window.dekkoModule = function (object) {

	var css = {
		wrap: {
			'display' 				: 'none',
			'width' 				: '728px',
			'height' 				: '90px',
			'position' 				: 'relative',
			'background' 			: "url('data:image/gif;base64,') no-repeat left top",
			'box-shadow' 			: '0px 0px 10px rgba(50, 50, 50, 0.6)'
		},
		link: {
			'text-decoration'		: 'none',
			'width'					: '100%',
			'height'				: '100%',
			'display'				: 'inline-block'
		},
		close: {
			none: {
				'display' 			: 'none',
				'width' 			: '16px',
				'height' 			: '16px',
				'position' 			: 'absolute',
				'padding' 			: '0px',
				'top' 				: '2px',
				'right' 			: '2px',
				'cursor' 			: 'pointer',
				'color'				: '#fff',
				'background'		: 'none',
				'z-index' 			: '1px'
			},
			normal: {
				'text-align' 		: 'center',
				'color'				: '#fff'
			},
			hover: {
				'color'				: '#000',
				'border'			: '1px solid #000'
			}
		}
	},
	t = {};

	try {

		t.append = this.shadowCreate(object.append);

		t.wrap = $('<div/>', {
			'id': object.name + '-wrap',
			'css': css.wrap
		}).appendTo(t.append);

		t.close	= $('<div/>', {
			'css': css.close.none,
			'html': window.dekkoJS.svg.close(css.close.none)
		}).appendTo(t.wrap);

		t.link = $('<a/>', {
			'href': object.item.url,
			'target': '_blank',
			'css': css.link
		}).appendTo(t.wrap);

		t.wrap.delay(object.item.delay)
			.fadeIn(object.item.effects.duration, object.item.effects.easing[0], function() {
				$(this).stop(true);
			});

		t.link.mouseover(function() {
			if (t.close.is(':visible') === false)
				return t.close.delay(object.item.effects.duration).fadeIn(600);
		});

		t.close.click(function() {
			t.wrap.fadeOut((object.item.effects.duration/2), object.item.effects.easing[1], function() {
				window.dekkoJS.setStore(object.closePoint, [true, object.date.now()]);
				t.wrap.remove();
			});
		});

		t.link.on('auxclick touchstart click', function() {
			return window.dekkoJS.clickAdvert(object);
		});

	} catch (e) {
		return this.exceptionsMessage({
			message: object.name + ' ' + e,
			status: this.console.dekkothrowError,
			date: new Date().toISOString()
		});
	} finally {
		return this.notice(object);
	}
};